        public ObservableCollection<IconModel> Icons
        {
            get { return _icons; }
            set { _icons = value; }
        }

        public IconModel SelectedIcon
        {
            get { return _selectedIcon; }
            set
            {
                _selectedIcon = value;
                OnPropertyChanged();
            }
        }

        public bool FillIcon
        {
            get { return _fillIcon; }
            set
            {
                _fillIcon = value;
                OnPropertyChanged();
            }
        }
        
        public ICommand CopyToClipboardCommand { get; set; }
        public ICommand IconSelectedCommand { get; set; }
        public ICommand HideCommand { get; set; }

        private void InitCommands()
        {
            CopyToClipboardCommand = new DelegateCommand(ExecuteCopyToClipboardCommand, CanExecuteCopyToClipboardCommand);
            IconSelectedCommand = new DelegateCommand(ExecuteIconSelectedCommand, CanExecuteIconSelectedCommand);
            HideCommand = new DelegateCommand(ExecuteHideCommand, CanExecuteHideCommand);
        }

        private bool CanExecuteCopyToClipboardCommand(object o)
        {
            return true;
        }

        private void ExecuteCopyToClipboardCommand(object o)
        {
            Clipboard.SetText(SelectedIcon.Data);
        }

        private bool CanExecuteHideCommand(object o)
        {
            return true;
        }

        private void ExecuteHideCommand(object o)
        {
            SelectedIcon = null;

            foreach (var icon in Icons)
            {
                icon.IsSelected = false;
            }
        }

        private bool CanExecuteIconSelectedCommand(object sender)
        {
            return true;
        }

        private void ExecuteIconSelectedCommand(object sender)
        {
            SelectedIcon = (IconModel)((ToggleButton)sender).DataContext;

            foreach (var icon in Icons)
            {
                icon.IsSelected = false;
            }

            SelectedIcon.IsSelected = true;
        }
    }
